import UserDynamiqueTab from "./UserDynamiqueTab";
import {useState} from "react";

export default function UserOutput(props) {
    return (
        <table className="result">
            <thead>
            <tr>
                <th>Year</th>
                <th>Total Savings</th>
                <th>Interest (Year)</th>
                <th>Total Interest</th>
                <th>Invested Capital</th>
            </tr>
            </thead>
            <tbody>


            {props.data.map((entry) => {

                return (
                    <tr>
                        <td>{entry.year}</td>
                        <td>{entry.savingsEndOfYear}</td>
                        <td>{entry.yearlyInterest}</td>
                        <td>{entry.totalInterest}</td>
                        <td>{entry.yearlyContributionT}</td>
                    </tr>

                    // <UserDynamiqueTab
                    //     year={entry.year}
                    //     savingsEndOfYear={entry.savingsEndOfYear}
                    //     yearlyInterest={entry.yearlyInterest}
                    //     totalInterest={entry.totalInterest}
                    //     yearlyContributionT={entry.yearlyContributionT}
                    //     key={entry.key}
                    // />
                );
            })}
            </tbody>
        </table>
    )
}
